import React from "react";

function createStudyPage() {
  return (
    <form>
      <label>
        Name:
        <input
          type="text"
          value={this.state.value}
          onChange={this.handleChange}
        />
      </label>
      <input type="submit" value="Submit" />
    </form>
  );
}

export default createStudyPage;
